					<script>
						let playdio = {
							'play': function() {
								jQuery('#audioLoad')[0].muted = false;
								jQuery('#audioLoad')[0].play();
								jQuery('#btnPlay').attr('src',
									'https://laylialby.com/resepsi/wp-content/uploads/2023/10/pause.png');
							},
							'pause': function() {
								jQuery('#audioLoad')[0].pause();
								jQuery('#btnPlay').attr('src',
									'https://laylialby.com/resepsi/wp-content/uploads/2023/10/play.png');
							},
							'permission': 'true',
							'playing': true
						};

						jQuery(document).ready(function() {


							setTimeout(function() {
								var promise = jQuery('#audioLoad')[0].play();
								if (promise !== undefined) {
									promise.then(_ => {
										playdio.play();
									}).catch(error => {
										playdio.permission = 'false';
										elementorFrontend.documentsManager.documents[45].showModal();
									});
								}
								elementorFrontend.documentsManager.documents[45].showModal();
							}, 200);
							jQuery('a').click(function() {
								if (playdio.playing === true) {
									playdio.play();
								}
							});
						});
						jQuery("body,html").bind("touchstart touchmove scroll mousedown DOMMouseScroll mousewheel keyup", function(e) {
							if (playdio.playing === true) {
								playdio.play();
							}
						});
						jQuery(document).on('click', '#lihat-undangan', function() {
							playdio.play();
							elementorFrontend.documentsManager.documents[45].getModal().hide();

						});
						jQuery(document).on('click', '#frameBtnPlay', function() {
							var myAudio = document.getElementById('audioLoad');
							if (myAudio.duration > 0 && !myAudio.paused) {
								staplay = 'play';
							} else {
								staplay = 'pause';
							}

							if (staplay === 'play') {
								playdio.pause();
								playdio.playing = false;
							} else {
								playdio.play();
								playdio.playing = true;
							}
						});
						const btn = document.getElementById('lihat-undangan');

						btn.addEventListener('click', () => {
							const box = document.getElementsByClassName('bagian-lihat-undangan')[0];

							// 👇️ removes element from DOM
							box.style.display = 'none';
						});
					</script>
				</div>
